export default function Map() {
    var ee = require('@google/earthengine');

    var CLIENT_ID = '783199902705-6380kgt5hno2jk7depl3pr4cmj0qdspt.apps.googleusercontent.com'
    // Authenticate using one (but not both) of the methods below.
    // Initialize client library and run analysis.

    var initialize = function() {
        ee.initialize()
    };

    // Authenticate using an OAuth pop-up.
    ee.data.authenticateViaOauth(CLIENT_ID, initialize, function(e) {
        console.error('Authentication error: ' + e);
    }, null, function() {
        ee.data.authenticateViaPopup(initialize);
    });

    // Run an Earth Engine script.
    var image = new ee.Image('srtm90_v4');
    image.getMap({min: 0, max: 1000}, function(map) {
        console.log(map);
    });

    return (
        <div class="g-signin2" data-onsuccess="onSignIn"></div>
    )
}
